    <script id="lua" type="text/lua">
      function _init()
       frame = 0
       second = 0
       radius = 48
      end

      function _tick()
       frame += 1
       if frame % 60 == 0 then
        second += 1
       end
      end

      function _draw()
       cls(7)
       clock()
       hand(frame, 13, radius - 4)
       hand(second, 1, radius - 16)
      end

      function clock()
       circfill(63, 63, radius, 11)
       circ(63, 63, radius, 3)
      end

      function angle(n)
       return (
        (3 * 3.143 / 2) +
        (((3.143 * 2) / 60)* n)
       )
      end

      function hand(n, c, r)
       line(
        63,
        63,
        63 + r * cos(angle(n)),
        63 + r * sin(angle(n)),
        c
       )
      end
    </script>
